import Header from "../../components/header";
import Footer from "../../components/footer";
import TextSection from "../../components/textSection";
import MainLogo from "../../components/mainLogo";
import styles from "./WalletPage.module.scss";
import WalletCardList from "src/components/wallet/WalletCardList";
import { useEffect, useState } from "react";
import axios from "axios";
import { storageToken } from "src/contexts/authContext";

function WalletPage() {
   const [userWallet, setUserWallet] = useState<{ money: number }>();
   const token = storageToken();

   useEffect(() => {
      (async function () {
         await axios
            .get("http://localhost:3000/users/wallet", {
               headers: {
                  ["x-access-token"]: token,
               },
            })
            .then((res) => {
               setUserWallet(res.data);
            });
      })();
   }, [userWallet]);

   return (
      <div className={styles.WalletPageIndex}>
         <Header />
         <MainLogo />
         <TextSection
            blueText={true}
            text="Esta Ã© a sua Carteira de Investimentos"
         />
         <TextSection text="Seus pokemons adquiridos:" />

         <WalletCardList userWallet={userWallet} />

         <Footer />
      </div>
   );
}

export default WalletPage;
